import React from 'react'
import Cards from "../cards/cards"

const cards = {
    display: "flex",
    justifyContent: "center",
    height: "100vh",
    alignItems: "center",
}

const populateCard = () => {
  return (
    <div style={cards}>
    <Cards/>
    </div>
  )
}

export default populateCard
